import { useNavigate } from "react-router-dom";
import * as f from "react-foundation";
export const Dashboard = () => {
  let nav = useNavigate();
  return (
    <>
      <f.Button style={{marginR}} onClick={() => nav("/luan")}>luan</f.Button>
      <f.Button onClick={() => nav("/dang")}>dang</f.Button>
      <f.Button onClick={() => nav("/tuan")}>tuan</f.Button>
    </>
  );
};
